import React from 'react'
import Dashboard from '../Dashboard'
import {Link} from 'react-router-dom'
import {Button} from 'react-bootstrap'
import styled from 'styled-components'
import CrewCard from '../../cards/CrewCard'
import ReviewCard from '../../cards/ReviewCard'

export default function IndivMovie() {
    return (
        <>
            <Dashboard/>
            <div>
                <Image>
                    <img style={{width: "200px", height: "300px"}} src="https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcT9J7XACn3tlD6v4UXRMvT2wJN8FGCCPeh8U3RkZ6__tR4wGhSo" alt=""/>
                </Image>
                <Btn><Button>Add To Favourites</Button></Btn>
                <Header><h2>Crew</h2></Header>
                <Scroll><CrewCard/></Scroll>
                <Header><h2>Reviews</h2></Header>
                <ReviewCard/>
            </div>

        </>
    )
}

const Header = styled.div`
    margin-left: 240px; 
    margin-top: 50px;
`
const Image = styled.div` 
    margin-left: 270px; 
    margin-top: 50px;
`
const Btn = styled.div `
    margin-left: 1000px; 
    margin-top: 20px;
`

const Scroll = styled.div`
    height: 300px; 
    padding-bottom: 50px; 
    overflow: hidden; 
    overflow-y: auto; 
`

/**Build a Recipe App With React | React Tutorial For Beginners https://www.youtube.com/watch?v=U9T6YkEDkMo&list=PLDyQo7g0_nsVHmyZZpVJyFn5ojlboVEhE&index=2 */
const Box1 = styled.div`
    margin-top: 50px; 
    border-radius: 10px;
    box-shadow: 0px 12px 18px -6px rgba(0, 0, 0, 0.3);  
    margin-left: 400px; 
    background: white;
    height: 120px; 
    width: 800px; 
`

const Box2 = styled.div`
    margin-top: 50px; 
    border-radius: 10px;
    box-shadow: 0px 12px 18px -6px rgba(0, 0, 0, 0.3);  
    margin-left: 400px; 
    background: white;
    min-height: 120px; 
    width: 800px; 
`

/**Build a Recipe App With React | React Tutorial For Beginners https://www.youtube.com/watch?v=U9T6YkEDkMo&list=PLDyQo7g0_nsVHmyZZpVJyFn5ojlboVEhE&index=2 */

const Title = styled.div `
    margin-top: 30px;
    margin-left: 20px;
`
const Text = styled.div`
    margin-top: 20px;
    margin-left: 40px;
`
const EditLink = styled(Link) `
    margin-left: 650px; 
`
